ng export...\n"); wasmtime_extern_t run; bool ok = wasmtime_instance_export_get(context, &instance, "g", 1, &run); assert(ok); assert(run.kind == WASMTIME_EXTERN_FUNC); // Call. printf("Calling export...\n"); wasmtime_val_t args[2]; args[0].kind = WASMTIME_I32; args[0].of.i32 = 1; args[1].kind = WASMTIME_I64; args[1].of.i64 = 2; wasmtime_val_t results[2]; error = wasmtime_func_call(context, &run.of.func, args, 2, results, 2, &trap); if (error != NULL || trap != NULL) exit_with_error("failed to call run", error, trap); // Print result. printf("Printing result...\n"); printf("> %"PRIu64" %"PRIu32"\n", results[0].of.i64, results[1].of.i32); assert(results[0].kind == WASMTIME_I64); assert(results[0].of.i64 == 2); assert(results[1].kind == WASMTIME_I32); assert(results[1].of.i32 == 1); // Shut down. printf("Shutting down...\n"); wasmtime_store_delete(store); wasm_engine_delete(engine); // All done. printf("Done.\n"); return 0;
} static void exit_with_error(const char *message, wasmtime_error_t *error, wasm_trap_t *trap) { fprintf(stderr, "error: %s\n", message); wasm_byte_vec_t error_message; if (error != NULL) { wasmtime_error_message(error, &error_message); wasmtime_error_delete(error); } else { wasm_trap_message(trap, &error_message); wasm_trap_delete(trap); } fprintf(stderr, "%.*s\n", (int) error_message.size, error_message.data); wasm_byte_vec_delete(&error_message); exit(1);
}

